//
export const addPet = (pet) => {
  return {
    type: "ADD_PET",
    payload: pet,
  };
};

export const addPetList = (petId, vaccinationList) => {
  return {
    type: "ADD_PET_LIST",
    payload: {
      petId,
      vaccinationList,
    },
  };
};

export const addVaccination = (petId, vaccination) => {
  return {
    type: "ADD_VACCINATION",
    payload: {
      petId,
      vaccination,
    },
  };
};
